script: |
  super -f text -I q5904.spq | sort > q5904.out

inputs:
  - name: q5904.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col0 * + col0 * + + col0 BETWEEN ( + CAST ( ( + - ( col0 ) ) AS INTEGER ) * 24 ) AND 65 / + ( - col0 ) + col0;
  - name: tab1

outputs:
  - name: q5904.out
    data: |
      51	14	96
      85	5	59
      91	47	68
